import React from 'react';
import '../styles/SelectionButton.css'; 
const SelectionButton = ({ isSelected, onSelect }) => {
  const handleClick = () => {
    onSelect();
  };

  return (
    <button
      onClick={handleClick}
      className={`selection-button ${isSelected ? 'selected' : ''}`}
    >
      {isSelected ? 'Selected' : 'Select'}
    </button>
  );
};

export default SelectionButton;
